import React from "react";
import NewsCards from "./NewsCards";

function Home() {
  return (
    <div className="home-content">
        <div className="cover">
            <h1>Rise and Grind.</h1>
            <button className="btn btn-primary">Get Started</button>
        </div>
        <div className="grid-wrapper">
            <NewsCards />
        </div>
    </div>
  );
}

export default Home;
